import React from "react";

function MainLanding(props) {
  return (
    <div className="text-center">
      <h2>Welcome to Barnwood!</h2>
        <p style={{marginTop: "30px"}}>
          This is a React application for creating, reading, updating, and deleting products and orders.
          A user registration system also exists, as well as a messaging system for each product.
          Please note that the order system currently only exists in a sandbox environment, meaning money is not 
          really being spent and orders are not actually being delivered. I intend to have this working in a real life 
          environment someday. Thanks for visiting!
        </p>
    </div>
  )
}

export default MainLanding;
